import axios from 'axios';

const initState = {
    todoList: axios.get('http://localhost:4000/todos/')
                .then(res => {
                    console.log(res.data);
                }),
}

const todoList = (state = initState, action) => {
    switch(action.type) {
        default:
            return state;
    }
}

export default todoList;
